import React, { Component } from 'react';
import Container from 'react-bootstrap/Container';


export class HowTo extends Component {
    render() {
        return (
            <Container fluid
                style={{
                    backgroundColor: "lightgrey",
                    margin: "2% 0 1% 0",
                    textAlign: "left",
                    padding: "1% 1% 1% 1%"
                }}
            >
                <p><strong>Tab Explaination: </strong><a href="#legend" style={{ color: "#0056b3" }}></a></p>
                <p><strong>Intensive Care: </strong> Intensive Care Unit patients must select 'Intensive Care' tab <a href="#legend" style={{ color: "#0056b3" }}></a></p>
                <p><strong>Acute respiratory distress syndrome: </strong> Patients suffering from ARDS must select this option. <a href="#legend" style={{ color: "#0056b3" }}></a></p>
                <p><strong>Mortality: </strong> This tab gives ths risk of mortality. <a href="#legend" style={{ color: "#0056b3" }}></a></p>
                <p><strong>Use : </strong> As part of Individual Project for CS6400 this web application is for people to perform a basic assessment and risk calculation of a COVID-19 patient ending up in the ICU, developing acute respiratory distress syndrome (ARDS), and overall death. The data has been reviewed and compiled from studies published about patients in Wuhan, listed at the <a href="#legend" style={{ color: "#0056b3" }}></a></p>
                <p> <strong>Warning: </strong> Results provided by below test are indicative purpose only and should not be considered final. </p>

            </Container>
        )
    }
}

export default HowTo
